  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bowdoin NWR outlines
  Refuge accomplishments from September through December of 1957. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, raptors, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments and collections and receipts.
  Resource management is outlined; topics include grazing, haying, and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes Refuge visitors, Refuge participation,
  and hunting. N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
